import { useParams } from "react-router-dom"
export function FoundClimber({climbers}){
    const {climberID} = useParams();
    function findClimber() {
      const climber = climbers.find(climber => climber.id === parseInt(climberID))
      if (!climber)
        return "wspinacz nie istnieje"
      
      return climber.name+" "+climber.surename+" "+climber.age
      }
    return <h1>{findClimber()}</h1>
}
